                console.log(result.data.results)
                console.log(result.data)
                setPokemons(result.data)


            } catch (e) {
                console.error(e);
            }
        }

        fetchData()

    }, [])

    return (
        <>
          <ul>
               {pokemons && pokemons.map((pokemon) => {
                   return <li key={pokemon.name}>
